/**
 * 这是一个示例TypeScript文件
 */

class Example {
  private name: string;
  private createdAt: Date;
  
  /**
   * 构造函数
   * @param name 名称
   */
  constructor(name: string) {
    this.name = name;
    this.createdAt = new Date();
  }
  
  /**
   * 打印问候语
   */
  public greet(): void {
    console.log();
  }
  
  /**
   * 生成随机数列表
   * @param count 数量
   * @returns 随机数列表
   */
  public generateRandomNumbers(count: number = 5): number[] {
    const numbers: number[] = [];
    for (let i = 0; i < count; i++) {
      numbers.push(Math.floor(Math.random() * 100) + 1);
    }
    return numbers;
  }
}

// 示例使用
const example = new Example('测试用户');
example.greet();
console.log('随机数:', example.generateRandomNumbers());


